import React, {Component} from 'react';
import Todos from './component/Todos';
import './App.css';

class App extends Component {
  state = {
    todos: [
      {
        id: 1,
        title: 'Take out of trash',
        completed: false
      },
      {
        id: 2,
        title: 'Dinner',
        completed: false
      },
      {
        id: 3,
        title: 'Zoom',
        completed: false
      }
    ]
  }
  render() {
    return (
      <div className = "App">
          <Todos todos = {this.state.todos}/>
      </div>
    );
  }
}
export default App;
